window.bookSummaryJSON = "<p><b>The thrilling conclusion to the </b><b><i>New York Times</i></b><b> best-selling series \"made for fans of Victoria Aveyard and Sabaa Tahir\" (</b><b><i>Bustle</i></b><b>), </b><b><i>Ember Queen</i></b><b> is an epic fantasy about a throne cruelly stolen and a girl who must fight to take it back for her people.</b> </p> <p>Princess Theodosia was a prisoner in her own country for a decade. Renamed the Ash Princess, she endured relentless abuse and ridicule from the Kaiser and his court. But though she wore a crown of ashes, there is fire in Theo's blood. As the rightful heir to the Astrean crown, it runs in her veins. And if she learned anything from her mother, it's that a Queen never cowers. </p> <p>Now free, with a misfit army of rebels to back her, Theo must liberate her enslaved people and face a terrifying new enemy: the new Kaiserin. Imbued with a magic no one understands, the Kaiserin is determined to burn down anyone and everything in her way.</p> <p>The Kaiserin's strange power is growing stronger, and with Prinz SÃ¸ren as her hostage, there is more at stake than ever. Theo must learn to embrace her own power if she has any hope of standing against the girl she once called her heart's sister.</p>"; 
